d_objs = D.objects
parent_obj = d_objs.new(mesh_entity["name"], None)
tr = mesh_entity["transform"]
parent_obj.location = tr["location"]
parent_obj.rotation_mode = tr["rotation_mode"]
parent_obj.rotation_quaternion = tr["rotation_quaternion"]
